-- Table: restaurants
CREATE TABLE `restaurants` (
  `id`                BIGINT(20)    NOT NULL AUTO_INCREMENT,
  `name`              VARCHAR(255)  NOT NULL,
  `phone`             VARCHAR(30),
  `website`           VARCHAR(30),
  `working_hours`     VARCHAR(11),
  `short_information` TEXT,
  `information`       TEXT,
  `image`            LONGBLOB,
  PRIMARY KEY (`id`)
) ENGINE = InnoDB DEFAULT CHARSET = UTF8;

INSERT INTO restaurants.restaurants (name, phone, website, working_hours, short_information, information, image) VALUES ('Noma', '+45 32 96 32 97', 'www.noma.dk', '8:00-22:00', 'В ресторане Нома представлена скандинавская кухня. Его основатели, Рене Редцепи (René Redzepi) и Клаус Мейер (Claus Meyer), попытались переосмыслить скандинавское искусство приготовления пищи. Кухня Номы может считаться скорее современной интерпретацией нордической кухни, нежели классической кухней, в котором помимо прочего подают мох, лишайник и костный мозг.', 'Нома (дат. Noma) — известный ресторан скандинавской кухни в Копенгагене (Дания). В Красном гиде Мишлен он оценён в две звезды из трёх возможных. 26 апреля 2010 года признан «лучшим рестораном в мире» по версии престижного британского журнала «Restaurant», в 2011 возглавил список из 50 ресторанов по всему миру, составленный более чем 800 экспертами, ресторанными критиками и поварами. Годом ранее занимал в рейтинге этого журнала третье место. Название ресторана является аббревиатурой из слов «nordisk» (северная) и «mad» (еда).<br/>

Ресторан Нома располагается в здании старого склада на берегу канала в районе Кристиансхавн в центре Копенгагена. Здание склада находится на Гренландской торговой площади (Grønlandske Handelsplads), которая в течение 200 лет служила центром торговли с Фарерскими островами, Финнмарком, Исландией и Гренландией. Здесь хранились рыба, китовое масло, шкуры и другие товары перед продажей на европейские рынки. В 2004 году склад был преобразован в Североатлантический дом (Nordatlantens Brygge), центр искусства и культуры стран Североатлантического региона. Тогда же и был открыт ресторан Нома.<br/>

В ресторане Нома представлена скандинавская кухня. Его основатели, Рене Редцепи (René Redzepi) и Клаус Мейер (Claus Meyer), попытались переосмыслить скандинавское искусство приготовления пищи. Кухня Номы может считаться скорее современной интерпретацией нордической кухни, нежели классической кухней, в котором помимо прочего подают мох, лишайник и костный мозг.', );
INSERT INTO restaurants.restaurants (name, phone, website, working_hours, short_information, information, image) VALUES ('OsteriaFrancescana', '+39 059 223912', 'www.osteriafrancescana.it', '8:00-22:00', 'Заведение шеф-повара Массимо Боттура, прославившееся своим блюдом Five Ages of Parmigiano Reggiano из пяти необычных воплощений одного сыра, многие называют теперь не иначе как «славным разрушителем традиционной итальянской кухни».', 'Стены ресторана обвешаны фотографиями знаменитых посетителей. Кухонные приборы из серебра, белоснежные скатерти, классический стиль оформления заведения намекают на традиционное итальянское меню.<br/>Однако превосходный шеф-повар Массимо Боттура любит импровизировать, удивлять посетителей своими шедеврами. Более того, к нему приезжают коллеги со всего мира, чтобы перенять опыт и мастерство Массимо. Оливковое масло, особенный бальзамный уксус и виноград привозят с соседних районов. На месте пекут и хлеб четырех сортов, а коронному блюду шеф-повара 150 лет. Предлагается сыр пармезан 5 разных возрастов.<br/>Меню ресторана очень разнообразно, большая часть которого сможет удовлетворить даже самых требовательных вегетарианцев. К каждому блюду написана инструкция, как его есть и какой напиток лучше всего дополнит его вкус. Если сомневаетесь - официанты всегда помогут Вам с выбором.<br/>В ресторане всего 36 столиков, всегда заполненных посетителями. Бронировать места нужно за несколько месяцев. В среднем стоимость обеда для одного человека составляет 150 евро.', );
INSERT INTO restaurants.restaurants (name, phone, website, working_hours, short_information, information, image) VALUES ('WhiteRabbit', '8 (495) 663-39-99', 'www.whiterabbitmoscow.ru', '8:00-22:00', 'Расположенный под стеклянным куполом на шестнадцатом этаже Смоленского пассажа White Rabbit – проект ресторатора Бориса Зарькова.', null, );
INSERT INTO restaurants.restaurants (name, phone, website, working_hours, short_information, information, image) VALUES ('El Celler de Can Roca', '+34 972 22 21 57', 'www.cellercanroca.com', '8:00-22:00', 'Ресторанный комплекс El Celler De Can Roca является одним из пяти лучших ресторанов мира на протяжении трех лет подряд с 2013 года. <br/> Этот гастрономический ресторанный комплекс находится на севере города Жирона в Испании. Ресторан El Celler De Can Roca — одно из самых популярных заведений местных жителей и туристов, кухня ресторана неповторима и способна неожиданно удивлять сочетаниями продуктов, вкусов и ароматов.', null, );
INSERT INTO restaurants.restaurants (name, phone, website, working_hours, short_information, information, image) VALUES ('Eleven Madison Park', '+1 212-889-0905', 'www.elevenmadisonpark.com', '8:00-22:00', 'Eleven Madison Park славится театральной изысканностью подач своих блюд, которые обещают каждому гостю незабываемые впечатления.', null, );
INSERT INTO restaurants.restaurants (name, phone, website, working_hours, short_information, information, image) VALUES ('Central', '+51 1 2428515', 'www.centralrestaurante.com.pe', '8:00-22:00', 'В меню этого самобытного ресторана можно найти, пожалуй, все разнообразие вкусов, которым вообще может удивить туриста эта страна. Кроме того, осознание того факта, что многие мясные позиции в меню совсем недавно кормились в тропических лесах Амазонки, на берегу Тихого океана или на горных хребтах Анд, добавляет элемент любопытства даже в самый рядовой ужин.', null, );
INSERT INTO restaurants.restaurants (name, phone, website, working_hours, short_information, information, image) VALUES ('Mirazur', '+33 4 92 41 86 86', 'www.mirazur.fr', '8:00-22:00', 'По всей видимости, особый шарм средиземноморской кухне этого ресторана придает шаговая доступность до границы с Италией. Хотя немалую роль в это, конечно же, вносит и шеф-повар аргентинско-итальянского происхождения Мауро Колагрико.', null, );
INSERT INTO restaurants.restaurants (name, phone, website, working_hours, short_information, information, image) VALUES ('Mugaritz', '+34 943 52 24 55', 'www.mugaritz.com', '8:00-22:00', 'На обед в этом, еще одном испанском заведении, вам вынесут около 20 сетов, каждый из которых захочется съесть до конца. Дело в том, что к созданию меню приложил руку сам Андони Луис Адурис, наследник Феррана Адриа, называемого также кулинарным королем Испании. ', null, );
INSERT INTO restaurants.restaurants (name, phone, website, working_hours, short_information, information, image) VALUES ('Narisawa', '+81 3-5785-0799', 'www.narisawa-yoshihiro.com', '8:00-22:00', 'Новое сезонное меню этого японского ресторана получилось настолько удачным, что без долгих разговоров вознесло Narisawa сразу на восьмую строчку рейтинга. Особенностью его, конечно же, являются продукты, в том числе и морепродукты, произведенные почти полностью на территории страны.', null, );
INSERT INTO restaurants.restaurants (name, phone, website, working_hours, short_information, information, image) VALUES ('Steirereck', '+43 1 7133168', 'www.steirereck.at', '8:00-22:00', 'Успех этого семейного заведения во многом объясняется кулинарной преемственностью владельцев и особым способом приготовления традиционных блюд вроде шницеля. Архитектурный редизайн также пошел на пользу Steirereck, сделав ресторан внешне очень современным, но по-прежнему уютным внутри.', null, );
INSERT INTO restaurants.restaurants (name, phone, website, working_hours, short_information, information, image) VALUES ('Asador Etxebarri', '+34 946 58 30 42', 'www.asadoretxebarri.com', '8:00-22:00', 'Ресторан баскской кухни от специалиста по барбекю шеф-повара Виктора Аргинсониза, чья родная деревня находится неподалеку от Asador Etxebarri. Главной особенностью места является отсутствие практически всех современных кухонных помощников, использование множества продуктов собственного производства и просто золотые руки персонала.', null, );
INSERT INTO restaurants.restaurants (name, phone, website, working_hours, short_information, information, image) VALUES ('Dinner by Heston Blumenthal', '+44(0)20 7201 3833', 'www.dinnerbyheston.com', '8:00-22:00', 'В Лондоне есть заведение под названием Dinner by Heston Blumenthal. В нем пропагандируют поистине научный подход к кулинарии. Владелец заведения Хестон Блюменталь собственной персоной и шеф-повар Эшли Палмер-Уоттс многие годы исследовали гастрономическое прошлое своей страны, консультируясь с кулинарными историками и проводя часы в Британской библиотеке. ', null, );
INSERT INTO restaurants.restaurants (name, phone, website, working_hours, short_information, information, image) VALUES ('D.O.M.', '+55 (11) 3088 . 0761', 'www.domrestaurante.com.br', '8:00-22:00', 'В меню бразильского ресторана, как утверждают местные повара, только самые настоящие "жемчужины Амазонки". Уникальные продукты — это не единственная вещь, которой может похвастаться заведение. Интерьер также весьма впечатляет. Вход в ресторан открывает пятиметровая деревянная дверь, изысканные интерьеры отдают национальными мотивами, а открытая кухня завораживает и приковывает взгляды посетителей. ', null, );
INSERT INTO restaurants.restaurants (name, phone, website, working_hours, short_information, information, image) VALUES ('Gaggan', ' (662) 652 1700', 'www.eatatgaggan.com', '8:00-22:00', 'В меню присутствует большое разнообразие вегетарианских и диетических блюд, так что каждый найдет что-нибудь по душе. К слову, готовят местные повара не только традиционные блюда по проверенным рецептам, но и усовершенствованные аналоги, добавляя необычные ингредиенты и экспериментируя со вкусом.', null, );

