-- Table: comments
CREATE TABLE `comments` (
  `id`            BIGINT(20)   NOT NULL AUTO_INCREMENT,
  `restaurant_id` BIGINT(20)   NOT NULL,
  `user_id`       BIGINT(20)   NOT NULL,
  `comment`       TEXT         NOT NULL,
  `date`          TIMESTAMP,
  PRIMARY KEY (`id`),
