INSERT INTO restaurants.comments (restaurant_id, user_id, comment, date) VALUES (2, 1, 'Всем, кто считает себя гурманом обязательно нужно сходить сюда! Данный ресторан считается одним из самых лучших ресторанов Италии и не только по гиду Michelin, но также по рейтингу san pelengrino. Шеф данного ресторана реально творит провокационные чудеса с местной кухней Модены! Все блюда и весь интерьер выполнен в восхитительном стиле! Блюда в данном ресторане очень маленькие, но в данный ресторан.', '2017-01-25 23:33:39');
INSERT INTO restaurants.comments (restaurant_id, user_id, comment, date) VALUES (2, 1, 'Дорогие господа, в этот ресторан стоит идти, если вы разбираетесь в кухне: в продуктах, в методах приготовления, в специфике региона, в известных шеф-поварах и их специфических талантах. Вам также не помешает опыт вкушения пищи в подобных ресторанах, разговорный итальянский или английский и полное понимание того, что вы вступаете в мир искусства, кулинарного искусства. Не надо думать о деньгах', '2017-01-25 23:33:39');
